  let result = null;
  try {
    result = await cursor.explain(verbosity);
  } catch (error) {
    return await model.hooks.execPost('aggregate', this, [null], { error });
  }

  await model.hooks.execPost('aggregate', this, [result], { error: null });

  return result;
